sys_variable_value.value:
(function execute(inputs, outputs) {
    // Lookup record in the onboarding table by case number
    var gr = new GlideRecord('x_snc_ai_agents_0_fso_sma_onboarding');
    gr.addQuery('number', inputs.casenumber);
    gr.query();

    if (gr.next()) {
        // Return the sys_id of the reference field
        outputs.primary_account_holder = gr.getValue('primary_account_holder');
    } else {
        outputs.primary_account_holder = '';
        gs.info('[Flow Step] No onboarding record found for Case Number: ' + inputs.casenumber);
    }
})(inputs, outputs);

